import React from 'react'
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.js';

class Login extends React.Component{
    state={
        modal:false
    };
    toggle=()=> {
        this.setState({
            modal: !this.state.modal
        });
    };

    render(){
        return(
            <div>

                <button type="button" onClick={this.toggle} className="btn btn-primary" data-target="#exampleModal">
                    Launch demo modal
                </button>

<div>
                <div isOpen={this.state.modal} toggle={this.toggle} className="modal fade" id="exampleModal" tabIndex="-1" role="dialog" aria-labelledby="exampleModalLabel" aria-hidden="true">
                    <div className="modal-dialog" role="document">
                        <div className="modal-content">
                            <div className="modal-header">
                                <h5 className="modal-title" id="exampleModalLabel">Modal title</h5>
                                <button type="button" className="close" data-dismiss="modal" aria-label="Close">
                                    <span aria-hidden="true">&times;</span>
                                </button>
                            </div>
                            <div className="modal-body">
                                ...
                            </div>
                            <div className="modal-footer">
                                <button type="button" className="btn btn-secondary" data-dismiss="modal">Close</button>
                                <button type="button" className="btn btn-primary">Save changes</button>
                            </div>
                        </div>
                    </div>
                </div>
</div>
            </div>
        );
    }
}
export default Login;
